import React from 'react'

function Coor() {
    return (
        <>
         <div
        className="fullPage"
        style={{
          display: "flex",
          justifyContent: "space-evenly",
          flexDirection: "column",
          padding: "0 100px",
        }}
      ></div>   
        </>
    )
}

export default Coor
